import React from "react";

function Banner() {
  return (
    <section>
      <img src="https://images.pexels.com/photos/1051747/pexels-photo-1051747.jpeg?auto=compress&cs=tinysrgb&w=600" alt="error" />
    </section>
  );
}

export default Banner;
